import React from 'react';
import PropTypes from 'prop-types';
import { css } from 'emotion';
import InitialScreen from '../components/InitialScreen';

const propTypes = {
  dummy: PropTypes.string,
};

const Game = (props) => {
  return (
    <div className={styles.root}>
      <InitialScreen />
      {/*<ResultsScreen />*/}
    </div>
  );
};

const styles = {
  root: css({
    marginTop: 32
  })
};

Game.propTypes = propTypes;

export default Game;
